import '../index.css';

function Footer() {
    return (
        <footer className="bg-gray-800 text-white py-4 fixed bottom-0 w-full">
            <div className="container mx-auto text-center">
                <p>&copy; 2023 My Company. All rights reserved.</p>
            </div>
        </footer>
    );
}

export default Footer;
